import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigatot } from '@react-navigation/stack';
import React from 'react';
import Students from './Students';
import DenunciasScreen from './DenunciasScreen';
import DenunciaDetailScreen from './DenunciaDetailScreen';

const Stack = createStackNavigatot();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Students">
        <Stack.Screen name="Students" component={Students} />
        <Stack.Screen name="Denuncias" component={DenunciasScreen} />
        <Stack.Screen name="DenunciaDetail" component={DenunciaDetailScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
